import "./style.css";
import NavBar from "../../components/navbar/index.jsx";
import Estabelecimento from "../../components/estabelecimento";
import api from "../../services/api.js";
import { useState } from "react";


function Busca() {

  const[resultado, setResultado] = useState([]);

  function listarEstabelecimentos(){

    api.get('v1/estabelecimentos', {
      cod_cidade: localStorage.getItem('sessionCodCidade'),
      nome: "",
      idCategoria: "",
      idBanner: "",
      pagina: 0
    }).then(response => {
      setResultado(response.data);
    }).catch(err => {
      console.log(err);
    })
  }

  useState(e => {
    listarEstabelecimentos
  }, [])
  return (
    <div className="container-fluid mt-page">
      <NavBar />

      <div className="row m-2">
        <h3>Lanches</h3>
      </div>

      <div className="row m-2">
        {[1, 2, 3, 4, 5, 6, 7, 8, 9].map((e) => {
          return (
            <Estabelecimento
              key={e}
              url_img="https://d3sn2rlrwxy0ce.cloudfront.net/_800x600_crop_center-center_none/Burger-King-Novo-logo.png?mtime=20210125152539&focal=none&tmtime=20210726130340"
              nome="Burguer King"
              avaliacao={4}
              categoria="Lanche"
            />
          );
        })}
      </div>
    </div>
  );
}

export default Busca;
